Now we can finally start writing an actual GPU kernel. Expand this section if you are not familiar with how GPU-side CUDA works Firstly, we must explain a couple of things about GPU kernels, specifically, how they are executed. GPU Kernels (functions) are the entry point for executing anything on the GPU, they are the functions which will be executed from the CPU. GPU kernels do not return anything, they write their data to buffers passed into them. CUDA's execution model is very very complex and it is unrealistic to explain all of it in this section, but the TLDR of it is that CUDA will execute the GPU kernel once on every thread, with the number of threads being decided by the caller (the CPU). We call these parameters the launch dimensions of the kernel. Launch dimensions are split up into two basic concepts: Threads, a single thread executes the GPU kernel once , and it makes the index of itself available to the kernel through special registers (functions in our case). Blocks, Blocks house multiple threads that they execute on their own. Thread indices are only unique across the thread's block, therefore CUDA also exposes the index of the current block. One important thing to note is that block and thread dimensions may be 1d, 2d, or 3d. That is to say, i can launch 1 block of 6x6x6, 6x6, or 6 threads. I could also launch 5x5x5 blocks. This is very useful for 2d/3d applications because it makes the 2d/3d index calculations much simpler. CUDA exposes thread and block indices for each dimension through special registers. We expose thread index queries through cuda_std::thread. Now that we know how GPU functions work, let's write a simple kernel. We will write a kernel which does [1, 2, 3, 4] + [1, 2, 3, 4] = [2, 4, 6, 8]. We will use a 1-dimensional index and use the cuda_std::thread::index_1d utility method to calculate a globally-unique thread index for us (this index is only unique if the kernel was launched with a 1d launch config!). #[kernel]
pub unsafe fn add(a: &[f32], b: &[f32], c: *mut f32) { let idx = thread::index_1d() as usize; if idx < a.len() { let elem = &mut *c.add(idx); *elem = a[idx] + b[idx]; }
} If you have used CUDA C++ before, this should seem fairly familiar, with a few oddities: Kernel functions must be unsafe currently, this is because the semantics of Rust safety on the GPU are still very much undecided. This restriction will probably be removed in the future. We use *mut f32 and not &mut [f32]. This is because using &mut in function arguments is unsound. The reason being that rustc assumes &mut does not alias. However, because every thread gets a copy of the arguments, this would cause it to alias, thereby violating this invariant and yielding technically unsound code. Pointers do not have such an invariant on the other hand. Therefore, we use a pointer and only make a mutable reference once we are sure the elements are disjoint: let elem = &mut *c.add(idx);. We check that the index is not out of bounds before doing anything, this is because it is common to launch kernels with thread amounts that are not exactly divisible by the length for optimization. Internally what this does is it first checks that a couple of things are right in the kernel: All parameters are Copy. The function is unsafe. The function does not return anything. Then it declares this kernel to the codegen so that the codegen can tell CUDA this is a GPU kernel. It also applies #[no_mangle] so the name of the kernel is the same as it is declared in the code.

