Now that you have some kernels defined in a crate, you can build them easily using cuda_builder. cuda_builder is a helper crate similar to spirv_builder (if you have used rust-gpu before), it builds GPU crates while passing everything needed by rustc. To use it you can simply add it as a build dependency in your CPU crate (the crate running the GPU kernels): +[build-dependencies]
+cuda_builder = "XX" Where XX is the current version of cuda_builder. Then, you can simply invoke it in the build.rs of your CPU crate: use cuda_builder::CudaBuilder; fn main() { CudaBuilder::new("path/to/gpu/crate/root") .copy_to("some/path.ptx") .build() .unwrap();
} The first argument is the path to the root of the GPU crate you are trying to build, which would probably be ../name in our case. The second function .copy_to(path) tells the builder to copy the built PTX file somewhere. By default the builder puts the PTX file inside of target/cuda-builder/nvptx64-nvidia-cuda/release/crate_name.ptx, but it is usually helpful to copy it to another path, which is what such method does. Finally, build() actually runs rustc to compile the crate. This may take a while since it needs to build things like core from scratch, but after the first compile, incremental will make it much faster. Finally, you can include the PTX as a static string in your program: static PTX: &str = include_str!("some/path.ptx"); Then execute it using cust.

