Structs are always passed directly using byte arrays if they are passed by value in the function. This corresponds to what is expected by CUDA/the PTX ABI. For example: #[derive(Clone, Copy)]
#[repr(C)]
pub struct Foo { pub a: u16, pub b: u64, pub c: u128,
} #[kernel]
pub unsafe fn kernel(a: Foo) { /* ... */
} will map to the following PTX: .visible .entry kernel( .param .align 16 .b8 kernel_param_0[32]
) Consequently, it is expected that you will pass the struct by value when launching the kernel, and not by reference (by allocating a device box): let foo = Foo { a: 5, b: 6, c: 7
}; unsafe { launch!( module.kernel<<<1, 1, 0, stream>>>(foo) )?;
} And not let foo = DeviceBox::new(Foo { a: 5, b: 6, c: 7
}); unsafe { launch!( module.kernel<<<1, 1, 0, stream>>>(foo.as_device_ptr()) )?;
}

