Slices are passed as two parameters , both 32-bit on nvptx or 64-bit on nvptx64. The first parameter is the pointer to the beginning of the data, and the second parameter is the length of the slice. For example: #[kernel]
pub unsafe fn kernel(a: &[u8]) { /* ... */
} Will map to the following PTX (on nvptx64): .visible .entry kernel( .param .u64 kernel_param_0, .param .u64 kernel_param_1
) Consequently, it is expected that you will pass the pointer and the length as multiple parameters when calling the kernel: let mut buf = [5u8; 10].as_dbuf()?; unsafe { launch!( module.kernel<<<1, 1, 0, stream>>>(buf.as_device_ptr(), buf.len()) )?;
} You may get warnings about slices being an improper C-type, but the warnings are safe to ignore, the codegen guarantees that slices are passed as pairs of params. You cannot however pass mutable slices, this is because it would violate aliasing rules, each thread receiving a copy of the mutable slice would violate aliasing rules. You may use a &[UnsafeCell<T>] then convert an element to a mutable ref (once you know the element accesses are disjoint), or more commonly, use a raw pointer.

