This is probably the most asked question by far, so let's break it down in detail. TL;DR There are things we fundamentally can't check, but just because that is the case does not mean we cannot still prevent a lot of problems we can check. Yes it is true that GPU kernels have much more unsafe than CPU code usually, but why is that? The reason is that CUDA's entire model is not based on safety in any way, there are almost zero safety nets in CUDA. Rust is the polar opposite of this model, everything is safe unless there are some invariants that cannot be checked by the compiler. Let's take a look at some of the invariants we face here. Take this program as an example, written in CUDA C++: __global__ void kernel(int* buf, int* other)
{ int idx = threadIdx.x; buf[idx] = other[idx];
} int main(void)
{ int N = 50; int* a, b, d_a, d_b; a = (int*)malloc(N*sizeof(int)); b = (int*)malloc(N*sizeof(int)); cudaMalloc(&d_a, N*sizeof(int)); cudaMalloc(&d_b, N*sizeof(int)); for (int i = 0; i < N; i++) { a[i] = 0.0f; b[i] = 2.0f; } cudaMemcpy(d_a, a, N*sizeof(float), cudaMemcpyHostToDevice); cudaMemcpy(d_b, b, N*sizeof(float), cudaMemcpyHostToDevice); kernel<<<1, N>>>(d_a, d_b); cudaMemcpy(d_a, a, N*sizeof(float), cudaMemcpyDeviceToHost); cudaMemcpy(d_b, b, N*sizeof(float), cudaMemcpyDeviceToHost); /* do something with the data */ cudaFree(d_a); cudaFree(d_b); free(a); free(b);
} You may think this looks innocent enough, it's a very easy and understandable program. But if you really think about it, this is a minefield of things that could go wrong. Let's list most of them: buf could be too small, that is undefined behavior (reading beyond allocated memory) similarly, other could also be too small. The kernel could have been called with too many or not enough parameters. The kernel could have been called with a different grid/block dimension than expected, which would cause a data race. Any of the cudaMalloc, cudaMemcpy, kernel launches, or cudaFree calls could have errored, which we dont handle and simply ignore. We could have forgotten to initialize the buffers. We could have forgotten to free the buffers. This goes to show that CUDA C/C++ and CUDA overall rely on shifting the burden of correctness from the API to the developer. However, Rust uses a completely opposite design model, the compiler verifies as much as it can, and burden is only shifted to the developer if its absolutely essential, behind unsafe. This creates a big problem for us, it is very difficult (and sometimes impossible) to prove correctness statically when wrapping how CUDA works. We can solve a lot of the points using things like RAII and providing a high level wrapper, but we fundamentally cannot prove a lot of things, the most common place where this is shown is the CPU-GPU boundary, e.g. launching kernels. Firstly, we cannot verify that the PTX we are calling is sound, that it has no data races, writes into the right buffers, doesnt rely on undocumented invariants, and does not write invalid data to buffers. This already makes launching kernels perma-unsafe. Second, CUDA does zero validation in terms of kernel parameter mismatch, it will simply segfault on you, or even keep going but produce invalid data (or cause the kernel to cause undefined behavior). This is a design flaw in CUDA itself, we have no control over it and no 100% reliable way to fix it, therefore we must shift this burden of correctness to the developer. Moreover, the CUDA GPU kernel model is entirely based on trust, trusting each thread to index into the correct place in buffers, trusting the caller of the kernel to uphold some dimension invariants, etc. This is once again, completely incompatible with how rust does things. We can provide wrappers to calculate an index that always works, and macros to index a buffer automatically, but indexing in complex ways is a core operation in CUDA and it is impossible for us to prove that whatever the developer is doing is correct. Finally, We would love to be able to use mut refs in kernel parameters, but this is would be unsound. Because each kernel function is technically called multiple times in parallel with the same parameters, we would be aliasing the mutable ref, which Rustc declares as unsound (aliasing mechanics). So raw pointers or slightly-less-unsafe need to be used. However, they are usually only used for the initial buffer indexing, after which you can turn them into a mutable reference just fine (because you indexed in a way where no other thread will index that element). Also note that shared refs can be used as parameters just fine. Now that we outlined why this is a thing, why is using rust a benefit if we still need to use unsafe? Well it's simple, eliminating most of the things that a developer needs to think about to have a safe program is still exponentially safer than leaving everything to the developer to think about. By using rust, we eliminate: The forgotten/unhandled CUDA errors problem (yay results!). The uninitialized memory problem. The forgetting to dealloc memory problem. All of the inherent C++ problems in the kernel beyond the initial buffer indexing. The mismatched grid/block dimension problem (by providing thread::index). The forgetting to memcpy data back problem. And countless other problems with things like graphs, streams, devices, etc. So, just because we cannot solve every problem with CUDA safety, does not mean we cannot solve a lot of them, and ease the burden of correctness from the developer. Besides, using Rust only adds to safety, it does not make CUDA more unsafe. This means there are only things to gain in terms of safety using Rust.
